<?php

declare (strict_types = 1);
use BureauPartners\MultiPost\Client;
use PHPUnit\Framework\TestCase;

class PrintOrderTest extends TestCase
{
    protected $client;

    public function setUp(): void
    {
        $this->client = new Client(getenv('EMAIL'), getenv('PASSWORD'), getenv('DOMAIN'));
    }

    public function testCanUserCreatePrintOrder()
    {
        $data = [
            'envelope'          => '2549dab0-943d-11ea-8f8a-0313e20b5a2f',
            'reference'         => 'test print order',
            'shipping_product'  => '2549dab0-943d-11ea-8f8a-0313e20b5a2d',
            'output_width'      => 210,
            'output_height'     => 297,
            'papertype'        => '78d13400-799c-11ea-b25d-71e7ccf0249b',
            'duplex_modus'      => 'duplex',
            'color'             => 'full color',
            'printing'          => 'inkjet',
            'document'          => [
                'reference'     => 'test document',
                'name'          => 'test document name',
                'file'          => ''
            ],
            'scheduleDatetime'  => date('Y-m-d'),
            'send'              => true
        ];

        $response = $this->client->createPrintOrder('test3', $data);

        $this->assertEquals('test print order', $response['reference']);
        $this->assertEquals('test document name', $response['documents'][0]['name']);
        $this->assertEquals('A4', $response['paper']['name']);
        $this->assertEquals('test', $response['envelope']['description']);
    }

    public function testCanUserSeePrintOrder()
    {
        $getOrder = $this->client->getPrintOrder('test', '34f17cb0-9f2f-11ea-9070-ebda60a5f389');

        $this->assertEquals('13', $getOrder['status']);
    }

    public function testCanUserDeletePrintOrder()
    {
        $response = $this->client->cancelPrintOrder('test3', '93601580-9f2f-11ea-a44d-af7ae260a3b4');

        $this->assertNotNull($response['cancellation_requested_at']);
    }
}